import React from 'react';
import {
  styContainer,
  styContainerDetail,
  styTitle,
  stySku,
  styPrice,
} from './style';

const List = () => {
  return (
    <div className={styContainer}>
      <div>
        <div className={stySku}>SKU: 8994096215986</div>
        <div className={styTitle}>Indomaret Wet Wipes 50s</div>
      </div>

      <div className={styContainerDetail}>
        <div className={styPrice}>
          <div >Cost Price : 4850</div>
          <div>Retail Price : 7800</div>
        </div>
        <div>QTY :1</div>
      </div>
    </div>
  );
};

export default List;
